 function Subscription() {
     const {handleSubmit, formState: {errors}, register} = useForm();
     const navigate = useNavigate();
     const [succesRegister, toggleSuccessRegister] = useState(true);

     async function registerUser(data) {
         try {

             const response = await axios.post('http://localhost:8083/users', data)
             if (response.status !== 201) {
                 toggleSuccessRegister(false);
             }
             navigate('/login')
         } catch (e) {
             console.error(e)
         }
     }
     return (
         <div className="page2">
             <Header icon={pic}/>
             <section className="form-xtra">
                 <form onSubmit={handleSubmit(registerUser)}>



                     <fieldset>
                         <legend> <h1>Registreren</h1></legend>


                         <Input
                             id="email"
                            labelText="Email:"
                             type="email"
                             name="emailadress"
                             // className="input__text input--medium"
                             placeholder="typ hier je emailadres"
                             validationRules={{
                                 required: {
                                     value: true,
                                     message: 'Dit veld is verplicht',
                                 }
                             }}
                             register={register}
                             errors={errors}
                         />



                         <Input
                             id="username"
                             labelText="Gebruikersnaam:"
                             type="username"
                             name="username"
                             // className="input__text input--medium"
                             placeholder="username"
                             validationRules={{
                                 required: {
                                     value: true,
                                     message: 'Dit veld is verplicht',
                                 }
                             }}
                             register={register}
                             errors={errors}
                         />

                         <Input
                             id="password"
                             labelText="Wachtwoord:"
                             type="password"
                             // name="password"
                             // className="input__text input--medium"
                             placeholder="wachtwoord"
                             validationRules={{
                                 required: {
                                     value: true,
                                     message: 'Dit veld is verplicht',
                                 }
                             }}
                             register={register}
                             errors={errors}
                         />

                         {!succesRegister &&
                             <h3>Something went wrong ðŸ˜³ Please contact Administrator - jftalavera@hotmail.com</h3>}

                         <button
                             type="submit"

                         >
                             registreren
                         </button>
                     </fieldset>
                 </form>
                 <p>Heb je al een account? Je kunt je <Link to="/Login">hier</Link> inloggen.</p>
             </section>
         </div>);
 }

 export default Subscription;














